import React, { Component } from "react";

export default class SanPhamGioHang extends Component {
  render() {
    const { sanPham } = this.props;
    return (
      <div className="card">
        <img className="card-img-top" src={sanPham.hinhAnh} alt={sanPham.hinhAnh}  width={200} height={200}/>
        <div className="card-body">
          <h4 className="card-title">{sanPham.tenSP}</h4>
          <button className="btn btn-success">Thêm giỏ hàng</button>
        </div>
      </div>
    );
  }
}
